void display_character(int x, int y, int animal){
	int startx = x;
	int starty = y;
	for (int i = 0; y < 50+starty; i++ ){
		if (animal == 0){
			if (bear[i] != 0x00000000) {
				drawPixelARGB32(x, y, bear[i]);
			}
		}
		else if (animal == 1){
			if (fox[i] > 7914368 || fox[i] < 5202757) drawPixelARGB32(x, y, fox[i]);
		}
		else {
			if (dog[i] > 16777215 || dog[i] < 8066061) drawPixelARGB32(x, y, dog[i]);
		}
		x++;
		if (x == startx + 38){
			y ++;
			x = startx;
		}
	}
}